import { useContext } from "react";
import { AuthContext } from "../context/auth.context";

export const ButtonsCheck = () => {
  const { context, setContext } = useContext(AuthContext);
  const handleClick = () => {
    setContext(false);
  };
  return (
    <>
      <h1>{context}</h1>
      <button onClick={handleClick}>Click me</button>
    </>
  );
};
